      IN Idcinema bigint,
      IN Idinterest int
)
BEGIN
   SELECT DISTINCT chairs.Idchair,chairs.NumberChair,chairs.RowChar,chairs.Idcategorychair,
  (select kt.Idbill from cinema.Ticket kt where kt.Idchair = chairs.Idchair and kt.Idinterest = interest.Idinterest) as bill
 FROM cinema.cinemainterest interest 
 LEFT JOIN cinema.Room room ON room.Idroom = interest.Idroom 
 LEFT JOIN cinema.Cinema cinemas ON cinemas.Idcinema = interest.Idcinema 
 LEFT JOIN cinema.chair chairs ON chairs.Idroom = interest.Idroom
 where room.Idroom = Idroom and interest.Idinterest = Idinterest and cinemas.Idcinema = Idcinema ;
END ;;
