CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_values`(
          IN numbers int,
          IN Idroom Bigint,
          IN numbersAllChair int
)
BEGIN
    DECLARE counter INT DEFAULT 1;
    DECLARE letter CHAR(1);
    DECLARE number INT;

    WHILE counter <= numbersAllChair DO
        SET letter = CHAR(64 + ((counter - 1) DIV numbers) + 1); -- Calculate letter 'A' to 'L'
        INSERT INTO cinema.chair(NumberChair, RowChar, Idroom, StatusChair, Idcategorychair, Roww) VALUES (counter, letter, Idroom, 0, 1, 0);
        SET counter = counter + 1;
    END WHILE;
END ;;
