CREATE DEFINER=`root`@`localhost` PROCEDURE `login`(
    IN p_name NVARCHAR(255),
    IN p_password NVARCHAR(255)
)
BEGIN
    DECLARE v_iduser BIGINT;
    
    SELECT a.Idusers INTO v_iduser FROM cinema.accounts a WHERE a.Username = p_name AND a.Password = p_password;
    
    IF v_iduser > 0 THEN
        SELECT Fullname,Email,Phone,Birthday,Idrole,avatar,Idusers,address,gender,statuss FROM cinema.Users WHERE Idusers = v_iduser;
    ELSE
        SELECT NULL AS Idusers; -- Return NULL for all columns
    END IF;
END ;;
