CREATE DEFINER=`root`@`localhost` PROCEDURE `ReportTicket`(
    IN queryDate nvarchar(100),
    IN datenow nvarchar(100),
    IN dateEnd nvarchar(100)
)
begin
   
SELECT 
    DATE_FORMAT(Datebill, '%Y-%m-%d %H:%i:%s') as Datebill,
    SUM(Totalamount) as Total
FROM 
    cinema.Bill bills 
WHERE 
    Datebill = queryDate
GROUP BY 
    DATE_FORMAT(Datebill, '%Y-%m-%d %H:%i:%s')
ORDER BY 
    DATE_FORMAT(Datebill, '%Y-%m-%d %H:%i:%s');
    
    SELECT 
    DATE_FORMAT(MIN(Datebill), '%Y-%m-%d %H:%i:%s') as Datebill, 
    SUM(Totalamount) as Total 
FROM 
    (
        SELECT 
            DATE_FORMAT(Datebill, '%Y-%m-%d %H') as DateHour,
            DATE_FORMAT(Datebill, '%Y-%m-%d %H:%i:%s') as Datebill, 
            Totalamount
        FROM 
            cinema.Bill bills 
        WHERE 
            Datebill >= datenow AND Datebill <= dateEnd
    ) subquery
GROUP BY 
    DateHour
ORDER BY 
    DateHour;


end ;;
DELIMITER ;
